"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Giving your child over-the-counter medicines (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/giving-your-child-over-the-counter-medicines-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H12539642\">",
"      <span class=\"h1\">",
"       What are over-the-counter medicines?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Over-the-counter (OTC) medicines are medicines that you can buy in a pharmacy or store without a doctor&rsquo;s prescription. They come in different forms, including pills, creams, and eye drops.",
"     </p>",
"     <p>",
"      OTC medicines are commonly used to treat:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Cough and cold",
"       </li>",
"       <li>",
"        Allergies",
"       </li>",
"       <li>",
"        Skin rashes, diaper rashes, or hives",
"       </li>",
"       <li>",
"        Diarrhea or constipation (trouble having bowel movements)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Some OTC medicines can cure conditions (such as rashes), but many only treat symptoms for a short time.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12539657\">",
"      <span class=\"h1\">",
"       How do I know the correct dose of medicine for my child?",
"      </span>",
"      &nbsp;&mdash;&nbsp;To figure out the correct dose, you need to look at the medicine&rsquo;s &ldquo;Drug Facts&rdquo; label (",
"      <a class=\"graphic graphic_figure graphicRef73468 \" href=\"mobipreview.htm?18/39/19066\">",
"       figure 1",
"      </a>",
"      ). The section called &ldquo;Directions&rdquo; tells you how much medicine to use and how often to use it.",
"     </p>",
"     <p>",
"      The dose might depend on your child&rsquo;s weight. If you do not know your child&rsquo;s weight, use the dosage for his or her age.",
"     </p>",
"     <p>",
"      To give your child the correct dose, make sure to:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Use the dosing device that comes with the medicine. If the medicine doesn&rsquo;t have a dosing device, ask the pharmacy, doctor, or nurse for one.",
"       </li>",
"       <li>",
"        Read the directions every time, even if you have given the medicine to your child before. Medicines can come in different strengths. Also, companies sometimes change medicines and doses.",
"       </li>",
"       <li>",
"        Follow the directions carefully. Do not give your child more medicine than directed. Giving your child extra medicine will not make him or her feel better, and it can cause serious problems.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12539672\">",
"      <span class=\"h1\">",
"       Can OTC medicines cause side effects?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. OTC medicines can cause side effects. The side effects depend on the medicine. Children are more likely to get side effects from OTC medicines than adults.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12539687\">",
"      <span class=\"h1\">",
"       Can I give my child 2 or more OTC medicines at the same time?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It depends on the medicines and their &ldquo;active ingredient.&rdquo; The active ingredient is the part of the medicine that treats symptoms. Every medicine has at least 1 active ingredient.",
"     </p>",
"     <p>",
"      To know what the active ingredient is, look at the Drug Facts label (",
"      <a class=\"graphic graphic_figure graphicRef73468 \" href=\"mobipreview.htm?18/39/19066\">",
"       figure 1",
"      </a>",
"      ). It&rsquo;s important to read the Drug Facts carefully, because medicines that treat different conditions can have the same active ingredient. For example, fever medicines and cough and cold medicines can have the same active ingredient.",
"     </p>",
"     <p>",
"      <strong>",
"       Do not give your child 2 medicines with the same active ingredient",
"      </strong>",
"      . Giving your child 2 medicines with the same active ingredient can cause an overdose. This can cause serious &ndash; and even life-threatening &ndash; problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12539702\">",
"      <span class=\"h1\">",
"       When should I call the doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Call the doctor or nurse if:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Your child has side effects or problems from an OTC medicine.",
"       </li>",
"       <li>",
"        Your child&rsquo;s symptoms don&rsquo;t get better or get worse after using an OTC medicine.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12539717\">",
"      <span class=\"h1\">",
"       What else should I do?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You should:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Talk to your child&rsquo;s doctor or nurse about OTC medicines at routine check-ups, before your child gets sick. Ask him or her which medicines you should use, when to use them, and how to use them. That way, if your child gets sick, you will know what to do.",
"       </li>",
"       <li>",
"        Ask questions if you are unsure which medicine to use or how to use it. You can ask the pharmacy worker or your child&rsquo;s doctor or nurse.",
"       </li>",
"       <li>",
"        Choose a medicine made to treat only the symptoms or condition your child has.",
"       </li>",
"       <li>",
"        Close the medicine tightly and store it out of your child&rsquo;s reach.",
"       </li>",
"       <li>",
"        Throw out medicine that has expired (gone bad).",
"       </li>",
"       <li>",
"        Teach your child that medicine shouldn&rsquo;t be eaten like candy, and that it can be dangerous to take too much.",
"       </li>",
"       <li>",
"        Keep the number for the Poison Control Center: 1-800-222-1222 (in the United States), in case your child gets too much medicine.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      You should NOT:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Give your child medicine made for adults, without first asking the doctor or nurse.",
"       </li>",
"       <li>",
"        Give cough and cold medicines to children younger than 6 years old. Cough and cold medicines can cause serious problems in young children. Plus, they are not likely to help with symptoms.",
"       </li>",
"       <li>",
"        Give",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?6/12/6342?source=see_link\">",
"         aspirin",
"        </a>",
"        to children younger than 18 years old. It can cause a life-threatening condition called Reye syndrome in young people.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12539732\">",
