var title_f35_21_36187="Centruroides scorpion envenomation grades";
var content_f35_21_36187=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F67046&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F67046&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Scorpion sting evaluation and treatment in the United States and Mexico",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup width=\"5%\">",
"     </colgroup>",
"     <colgroup span=\"2\" width=\"47%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Grade",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical findings",
"       </td>",
"       <td class=\"subtitle1\">",
"        Treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I",
"       </td>",
"       <td>",
"        Localized pain or paresthesias at site",
"       </td>",
"       <td>",
"        Symptomatic care, ie, analgesics, anxiolytics",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        II",
"       </td>",
"       <td>",
"        Local and remote pain or paresthesias",
"       </td>",
"       <td>",
"        Symptomatic care, ie, analgesics, anxiolytics",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        III",
"       </td>",
"       <td class=\"sublist1_start\">",
"        Localized pain with paresthesias and either:",
"       </td>",
"       <td rowspan=\"4\">",
"        Symptomatic care and supportive care, ie, analgesics, anxiolytics; give antivenom if available",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Cranial nerve abnormalities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Somatic skeletal neuromuscular dysfunction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        IV",
"       </td>",
"       <td>",
"        Localized pain, cranial nerve abnormalities, somatic skeletal neuromuscular dysfunction, and airway involvement are all present",
"       </td>",
"       <td>",
"        Symptomatic care and supportive care, ie, analgesics, anxiolytics; give antivenom if available",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Grading scale and treatment following envenomation with Centruroides species.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
