var title_f35_21_36188="Etiology of headache children";
var content_f35_21_36188=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F54034&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F54034&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Etiologic classification of headache in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Acute",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Localized",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Associated with URI (sinusitis, otitis media) or viral infection (influenza)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Post-traumatic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Related to oral cavity (dental abscess, TMJ dysfunction)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Brain abscess",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        First migraine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Generalized",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fever",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Systemic infection (influenza)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Central nervous system infection (meningitis, viral encephalitis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hypertension, hypertensive encephalopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Intracranial hemorrhage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Exertional",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        First migraine headache",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Trauma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Toxins (eg, carbon monoxide), medications (eg, amphetamines, oral contraceptives), or illicit substances",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Acute and recurrent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Migraine headache",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cluster headache",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Chronic and non-progressive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tension-type headache",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Psychiatric (depression, school phobia)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Post-traumatic, postconcussive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Medication overuse",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Chronic and progressive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Idiopathic intracranial hypertension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Space-occupying lesion (tumor, abscess, hemorrhage, hydrocephalus, vascular malformation)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Post-traumatic, postconcussive",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     URI: upper respiratory infection; TMJ: temporomandibular joint.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from:",
"     <br>",
"      <ol>",
"       <li>",
"        Morton L. Headache. In: Clinical Handbook of Pediatrics, Schwartz MW (Ed), Williams and Wilkins, Baltimore 1995, p.316.",
"       </li>",
"       <li>",
"        Rothner DA. Headache in adolescence. Adolescent Health Update. 2006; 18:1.",
"       </li>",
"       <li>",
"        Strasburger VC, Brown RT, Braverman PK, et al. Headache. In: Adolescent Medicine A Handbook for Primary Care, Lippincott Williams &amp; Wilkins, Philadelphia 2006. p.25.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
