"    Graph showing incidence of chronic kidney disease following nonrenal solid organ transplantation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 541px; height: 293px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Cumulative incidence of chronic renal failure (CRF), defined as an estimated glomerular filtration rate &le;29 mL/min per 1.73 m2, among 69,321 persons who received nonrenal solid organ transplants in the United States between January 1, 1990, and December 31, 2000. Cyclosporine was given to 60 percent and tacrolimus to 28 percent. Measurements of renal function were obtained at six-month intervals during the first year and annually thereafter.",
"    <div class=\"footnotes\">",
"    </div>",
